window.bookSummaryJSON = "<p>Mercenary Kate Daniels tries to save her city from divine intervention in this dramatized audiobook in the #1 New York Times bestselling urban fantasy series.</p> <p>As a mercenary who cleans up after magic gone wrong, Kate Daniels has seen her share of occupational hazards. Normally, waves of paranormal energy ebb and flow across Atlanta like a tide. But once every seven years, a flare comes, a time when magic runs rampant. Now Kate’s going to have to deal with problems on a much bigger scale: a divine one.</p> <p>When Kate sets out to retrieve a set of stolen maps for the Pack—Atlanta’s paramilitary clan of shape shifters—she quickly realizes much more is at stake. During a flare, gods and goddesses can manifest and battle for power. The stolen maps are only the opening gambit in an epic tug of war between two gods hoping for rebirth, and if Kate can’t stop the cataclysmic showdown, Atlanta may not survive...</p> <p>This dramatized audiobook also includes the Curran point of view story Soup.</p> <p>Performed by Nora Sofyan, Michael Glenn, Danny Gavigan, Kelly Baskin, Robb Moreira, Chris Davenport, Emlyn McFarland, Dawn Ursula, KenYatta Rogers, Drew Kopas, Eva Wilhelm, Jonathan Lee Taylor, Tia Shearer, Ken Jackson, Bradley Foster Smith, Yasmin Tuazon, Tony Nam, Earl Fisher, Tanja Milojevic, Ryan Carlo Dalusung, Sheree Wichard, Jacob Yeh, Michael John Casey, K'Lai Rivera, Bianca Bryan, Colleen Delany, Debi Tinsley, Christopher Walker, and Alejandro Ruiz.</p>"; 
